import React from 'react';

// import '../bannerb/Navigation.scss';

function Navigation() {

    return (
        <>
            <div className="component-nav">
                <div className="container-lg-fluid container-lg">
                    <nav className="navbar justify-content-between">
                        <a className="navbar-brand" href="/"><img src="/images/logo-google.png" alt="Logo"/></a>

                        <ul className="nav">
                            <li className="nav-item">
                                <a className="nav-link active" href="/">SUBSCRIBE</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link bt-primary ml-3" href="/">GET IT FREE</a>
                            </li>
                        </ul>
                    </nav>
                </div>
            </div>        
        </>
    )
}

export default Navigation;
